/**
 * https://leetcode-cn.com/problems/shortest-subarray-with-sum-at-least-k/
 * 0862.和至少为 K 的最短子数组
 * 难度：困难
 * 
 * 返回 A 的最短的非空连续子数组的长度，该子数组的和至少为 K 。
 * 如果没有和至少为 K 的非空子数组，返回 -1 。
 * 
 * 示例 1：
 * 输入：A = [1], K = 1
 * 输出：1
 * 
 * 示例 2：
 * 输入：A = [1,2], K = 4
 * 输出：-1
 * 
 * 示例 3：
 * 输入：A = [2,-1,2], K = 3
 * 输出：3
 * 
 * 提示：
 *   - 1 <= A.length <= 50000
 *   - -10 ^ 5 <= A[i] <= 10 ^ 5
 *   - 1 <= K <= 10 ^ 9
 */

/**
 * @param {number[]} A
 * @param {number} K
 * @return {number}
 */
var shortestSubarray = function (A, K) {
    let sum = 0, start = 0, result = 999999; //从极大值开始，寻找有没有更短的解
    return A.some((v, i) => {
        if (v >= K) return true; //如果某个元素>=K，结果是1
        sum += v;
        if (sum < 1) {
            sum = 0;
            start = i + 1;
            return;
        }
        for (let j = i; A[j] < 0; j--) {
            A[j - 1] = A[j] + A[j - 1];
            A[j] = 0;
        }
        if (sum >= K) {
            while (sum - A[start] >= K) sum -= A[start++]; //修剪结果序列最左侧的值
            result = Math.min(result, i - start + 1);
        }
    }) ? 1: result > 10 ** 5 ? -1 : result;
};

